class Stack
{
    constructor()
    {
        this.items = [];
    }
    push(element)
    {
        this.items.push(element);
    }
    pop()
    {
        if(this.items.length == 0)
        {
            return "underflow";
        }
        this.items.pop();
    }
    peek()
    {
        if(this.items.length === 0)
        {
            return "no elements in sthe stack";
        }
        return this.items[this.items.length - 1];
    }
    isEmpty()
    {
        return this.items.length === 0;
    }
}
let stack = new Stack();
stack.push(90);
stack.push(45);
stack.push(87);
console.log(stack);
console.log(stack.pop());
console.log(stack.peek());
console.log(stack.isEmpty());